import { images, useWindowDimensions } from '../constants'

function PushImage() {
  const { height, width } = useWindowDimensions()
  return (
    <div
      style={{
        height: height,
        width: width,
        backgroundColor: '#17191f',
      }}
    >
      <div
        style={{
          position: 'relative',
          top: '0px',
          left: '0px',
          height: height * 0.09,
          width: width * 0.25,
          backgroundColor: 'red',
        }}
      >
        <img
          src={'https://i.imgur.com/hPbfzZ2.png'}
          alt="Logo image T&C"
          style={{
            height: height * 0.09 - 26,
            marginTop: 13,
            marginBottom: 13,
            marginLeft: 10,
            marginRight: 13,
          }}
        />
      </div>

      <div
        style={{
          width: width * 0.7,
          height: height * 0.3,
          alignSelf: 'center',
          justifySelf: 'center',
          backgroundColor: 'blue',
        }}
      ></div>
    </div>
  )
}
export default PushImage
